import React from "react";

import BotonColRND from '../Componentes/BotonColRND.jsx';

import '../Css/ProyectosRND.css';

function ProyectosRND(){

  const rojo = Math.floor(Math.random() * 256);
  const verde = Math.floor(Math.random() * 256);
  const azul = Math.floor(Math.random() * 256);

  const color = `rgb(${rojo},${verde},${azul})`;

  return(
    <div>
      <div className='contenedor-experimentos'>
        <div className='texto-color-random'>
          <label className="colorRojo">Lorem, ipsum dolor sit amet consectetur adipisicing elit. Odio, repudiandae eveniet inventore vel dolorum dolorem quibusdam! Doloremque est numquam dolorem reiciendis aspernatur fugiat, quam quos esse incidunt molestiae eius facilis?</label>
          <BotonColRND/>
        </div>
        
        <div className='cara-o-sello'>
          <label>1.2</label>
        </div>

        <div className='gato-rpg'>
          <label>2.0</label>
        </div>

        <div className='imagen-random-gatoAPI'>
          <label>3.0</label>
        </div>

        <div className='chat'>
          <label>4.0</label>
        </div>
      </div>
    </div>
  );
};

export default ProyectosRND;
